]

const Photo = (props) => {
    const images = props.images;
    const imageItems= images.map((image) =>
        <li><img src="{image}"></img></li>
    );
    return (
        <div className="photo-container">
            <h2>Results</h2>
            <ul>
                {imageItems}
            </ul>
        </div>
    );
}

export default Photo;
